import React from "react";
import ReactCalendar from "./components/ReactCalendar";
import UpcomingApp from "./components/UpcomingApp";

function Calendar() {
  return (
    <div className="row">
      <div className="col"></div>
      <div className="col">
        {" "}
        <ReactCalendar />
      </div>

      <div className="col"></div>
    </div>
  );
}
function Card({
  transaction: { date, title, amount, type, account, role, url },
}) {
  return (
    <div className="container">
      <br />
      <br />
      <div className="card">
        <br />
        <div className="card-body">
          <div className="row">
            <div className="col-1"></div>
            <div className="col-2">
              <br />
              <h2>
                {" "}
                {date} <br />
                <br />
              </h2>
            </div>
            <div className="col-1"></div>
            <div className="col-5">
              <h1 className="card-title">
                <Link to={url}>{title}</Link>{" "}
              </h1>
              <h2>{description}</h2>

              <h2>{type}</h2>
            </div>
          </div>
          <br />
        </div>
      </div>
    </div>
  );
}
function EachCourse({ courseName, location, instructorName, day, month }) {
  return (
    <div className="container">
      <br />
      <br />
      <div className="card">
        <br />
        <div className="card-body">
          <div className="row">
            <div className="col-1"></div>
            <div className="col-2">
              <br />
              <h2>
                {" "}
                {month} <br />
                <br /> {day}
              </h2>
            </div>
            <div className="col-1"></div>
            <div className="col-5">
              <h1 className="card-title">{courseName}</h1>
              <h2>{location}</h2>

              <h2>{instructorName}</h2>
            </div>
          </div>
          <br />
        </div>
      </div>
    </div>
  );
}
function SearchFilter({ button }) {
  return <div className="btn"> {button} </div>;
}

function SearchBar() {
  return (
    <div className="card">
      <div className="card-body">
        {" "}
        <br />
        <h4 className="card-title">Filter Events</h4>
        <br />
        <SearchFilter button="Course Types" />
        <br />
        <br />
        <SearchFilter button="Cities" />
        <br />
        <br />
        <SearchFilter button="Instructors" />
        <br />
        <br />
        <SearchFilter button="Month" />
        <br />
        <br />
        <div className="right"> Clear Filters</div>
      </div>
    </div>
  );
}

class CourseTable extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="container">
        <div className="ctr header">
          <br />
        </div>
        <Calendar />

        <div className="row">
          <UpcomingApp />
          <div className="col-3">
            <br />
            <br />
            <SearchBar />
          </div>
          <div className="col-9"></div>
        </div>
      </div>
    );
  }
}

export default class UpcomingCoursesPage extends React.Component {
  render() {
    return <div className="container"></div>;
  }
}
